sample: '["\"Tasnif\\nImkoniyatlar ombori\\nHaqiqiy hayotdagi kabi rasm va ovoz. Apple
  TV 4K sizga ajoyib ko\u2019rinish beradi. Agar sizning karnay tizimingiz Dolby Atmos-ni
  qo\u2019llab-quvvatlasa, u holda uy kino zaliga aylantiriladi va siz boy atrof-muhit
  tovushiga yo\u2019l ochasiz.\\nSiz u erda bo\u2019lganingiz kabi\\nU HDR standartlaridan
  ikki baravar yuqori kadr tezligida videoni ijro eta oladi, bu ranglarni Real va
  tasvirni iloji boricha aniqroq qiladi. Hatto tezkor voqealar, masalan, sport musobaqalarini
  translyatsiya qilish ham batafsil bayon etilgan. Atrofdagi tabiat televizor ekranida
  juda ishonchli ko\u2019rinadi. Va YouTube videolari so\u2019zning tom ma\u2019noda
  jonlanadi.\\nSozlash oson\\nTelevizordagi tasvir sifatini sozlash uzoq va qiyin
  protseduraga aylanishi mumkin. Faqat bu holatda emas. Bundan buyon siz iPhone yordamida
  signal sifatini avtomatik ravishda sozlaysiz. Smartfonni faqat bir marta televizor
  ekraniga yo\u2019naltirish kerak, keyin o\u2019zingizni qulay his eting va kino
  va teleseriallardan butunlay yangi va ajoyib sifatda zavqlaning.\\nA15 Bionic protsessori
  javob tezligi va silliq Gui bilan ajralib turadi, bu o\u2019yinlarga o\u2019ziga
  xos dinamikani beradi.\\nVa ko\u2019p o\u2019yinchi qo\u2019llab-quvvatlashi bilan
  o\u2019yinchilar istalgan vaqtda o\u2019zlarining darajalari va o\u2019yinlardagi
  muvaffaqiyatlarini kuzatib borishlari, boshqa o\u2019yinchilarning pochta jo\u2019natmalari
  bilan tanishishlari va bir hisobdan boshqasiga o\u2019tishlari mumkin.\\nBundan
  tashqari, birlashtirilgan kontrollerlarni tanlash ko\u2019paydi: endi siz ularga
  Xbox va PlayStation simsiz masofadan boshqarish pultlarini ulashingiz mumkin.\\nBirgalikda
  qarang\\nKechasi audio yozuvlarni birgalikda ijro etish foydali bo\u2019ladi. Ikki
  juft Airpod-ni ulang va uxlayotganlarni bezovta qilmasdan har qanday hajmda filmlar
  va dasturlarni yoqing.\\nSmartfon boshqaruv paneli sifatida\\nAgar kerak bo\u2019lsa,
  qulflangan ekran va iPhone boshqaruv panelidagi o\u2019rnatilgan boshqaruv elementlaridan
  foydalaning. Ular orqali u boshlanadi, to\u2019xtaydi, oldinga, orqaga buriladi
  va televizorning ovoz balandligi sozlanadi.\\nSavol va Javoblar\\nSiz birinchi bo''lishingiz
  mumkin\\nBaholar\\nXozircha hechkim sharh yozmagan. Birinchilardan bo''ling baho
  bering\"", "\"O''zbekiston Professional futbol ligasi shu mavsumdan boshlab klublar
  bo''ynidagi har qanday qarzdorliklarga jiddiy e''tibor berib kelayotgani yaxshi
  ma''lum. Shu maqsadda Superliga hamda Pro-Liga klublari bilan 18 iyun kuni ochilib,
  15 iyul sanasida yopilgan yozgi transfer oynasida etarli darajada ish olib borildi.\\nPFL
  bu borada mavjud 30ta klubni transfer oynasi ochilishidan oldinoq ogohlantirib keldi.
  Natijada Superliga klublaridan tortib, Pro-Liga jamoalariga qadar PFLga hisobot
  topshirdi. Ya''ni, klublar bo''ynidagi qarzdorliklar, ularning futbolchi va murabbiylar
  oldidagi majburiyatlari aniq-tiniq belgilab olindi. Biroq \u201cYozyovon-Lochinlari\u201d
  hamda \u201cNorin\u201d klubi rahbariyati na transfer oynasi vaqtida va na undan
  keyin PFL talabini bajardi.\\nPFL Superliga klublarining oldiga 1 mart sanasiga
  qadar, Pro-Liga klublarining oldiga esa 20 aprelga qadar muddat belgilagan bo''lsa-da,
  jamoalar bu talablarni bajarmadi. Shu boisdan transfer oynasi vaqtida klublar bu
  masala yuzasidan PFLga tushuntirish berdi. Ya''ni, tashkilot klublarning og''ir
  sharoitidan kelib chiqib, ularga imkoniyat berishda davom etdi. Faqatgina, klub
  rahbarlarining kafolat xatidan so''ng.\\n\u201cYozyovon-Lochinlari\u201d hamda \u201cNorin\u201d
  klublari vakillari esa Pro-Ligadagi o''yinlariga bir kun vaqt qolganidagina aloqaga
  chiqdi. Kafolat xatlari ham faqatgina shu vaqtda taqdim etildi (to''lov muddati
  sanalari ko''rsatilmagani holda). Futbol klublarining bu qadar beparvoligini oqlash
  qiyin. PFL o''z komissarlari hamda hakamlarini yuqoridagi klublar ishtirokidagi
  o''yinlarga yubordi. Boisi, qarzdorlik bartaraf etilsa, ular o''yinni boshlashi
  kerak edi. PFL to uchrashuvning boshlanish vaqtigacha klublar moliyaviy qarzdorliklarini
  uzishini kutdi. Biroq klublar bu imkoniyatdan ham foydalana olmadi. Shundan kelib
  chiqilsa, \u201cYozyovon-Lochinlari\u201d klubi homiysi Dilmurod Ergashevning PFL
  borasida aytgan fikrlari mantiqqa to''g''ri kelmaydi.\\nPFL futbolga o''z sarmoyasini
  kiritayotgan tadbirkorlar bilan ishlash uchun doimo tayyor. Katta klublarni eplay
  olmayotgan tadbirkorlar bolalar futboliga sarmoya kiritsa ham, bu borada PFL ular
  bilan hamkorlik uchun keng eshiklar ochib beradi va o''z yordamini ayamaydi. Biroq
  Pro-Liga klublari bir necha yillardan buyon shu ahvolda ishlab o''rganib qolgandiki,
  ayni vaqtdagi qat''iy talablar ularga malol kelyapti.\\nPFL \u201cYozyovon-Lochinlari\u201d
  hamda \u201cNorin\u201d klublarini yana bir bor ogohlantiradi. Ish shu zaylda davom
  etsa, ular keyingi safar Pro-Ligadan muddatidan oldin chetlashtiriladi. Jamoalar
  homiylari mahalliy stadionlarni yaxshilash, bolalar futboliga sarmoya kiritish,
  klub tashkil qilishdan oldin, uning infratuzilmasi haqida o''ylaydigan bo''lsa,
  ular bilan hamkorlik davom ettiriladi. Shuningdek, bu kabi jamoalarga mamlakat 2-ligasida
  faoliyatlarini davom ettirish tavsiya etiladi.\"", "\"\u201cTurkiston\u201d saroyida
  8-mart \u2013 Xalqaro xotin-qizlar kuni munosabati bilan tantanali tadbir bo\u2018lib
  o\u2018tdi\\nMamlakatimizda ayolni ulug\u2018lash, unga hurmat-ehtirom ko\u2018rsatish,
  munosib hayot sharoitini yaratish, og\u2018irini yengil qilish davlat siyosatining
  muhim yo\u2018nalishlaridan biriga aylangan. Zero, jamiyat hayotining turli jabhalarini
  ravnaq toptirish, Vatanimizning jahon hamjamiyatidagi obro\u2018-e\u2019tiborini
  yuksaltirish, yoshlarni milliy va umuminsoniy qadriyatlar ruhida kamol toptirishda
  xotin-qizlarning munosib hissasi bor.\\nTurli sohalarda samarali mehnat qilayotgan
  xotin-qizlar 6-mart kuni Toshkentdagi hurriyatimiz, porloq istiqbolimiz va ezgu
  niyatlarimiz ramzi bo\u2018lgan Mustaqillik va ezgulik monumenti poyiga gullar qo\u2018ydi.
  Akademik V.Vohidov nomidagi Respublika ixtisoslashtirilgan jarrohlik markazining
  kardioxirurgiya majmuasi, Badiiy gimnastika bo\u2018yicha bolalar-o\u2018smirlar
  ixtisoslashtirilgan Respublika olimpiya zaxirasi sport maktabi, Toshkent shahrining
  Olmazor tumanidagi \u201cXonchorbog\u2018\u201d mahalla fuqarolar yig\u2018inidagi
  ayollar maslahat markazi faoliyati misolida mamlakatimizda xotin-qizlar salomatligini
  muhofazalash, qizlarni jismoniy tarbiya va sportga keng jalb etish, bolalar sportini
